// src/Pages/Admin/AllFeedbacks.js
import React, { useEffect, useState } from "react";
import api from "../../axiosConfig";
import { useNavigate } from "react-router-dom";
import "./AllUsers.css";

const AllFeedbacks = () => {
  const navigate = useNavigate();
  const [feedbacks, setFeedbacks] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    fetchFeedbacks();
  }, []);

  const fetchFeedbacks = async () => {
    try {
      const res = await api.get("Feedback/all-feedbacks");
      setFeedbacks(res.data);
      setLoading(false);
    } catch (err) {
      console.error(err);
      setError("Failed to load feedbacks");
      setLoading(false);
    }
  };

  if (loading) return <p style={{ textAlign: "center" }}>Loading feedbacks...</p>;
  if (error) return <p style={{ textAlign: "center", color: "red" }}>{error}</p>;
  const users = localStorage.getItem("userName");


  return (
    <div className="table-container">
      {/* Header identical to ViewStatus */}
      <header className="page-header">
        <h2>Welcome, {users}</h2>
        <button onClick={handleLogout} className="logout-btn">Logout</button>
      </header>
      <h2 style={{ textAlign: "center" }}>All Feedbacks</h2>
      {feedbacks.length === 0 ? (
        <p>No feedbacks found</p>
      ) : (
        <table>
          <thead>
            <tr>
              <th>User</th>
              <th>Mentor</th>
              <th>Week</th>
              <th>Rating</th>
              <th>Status</th>
              <th>Submitted On</th>
            </tr>
          </thead>
          <tbody>
            {feedbacks.map((f) => (
              <tr key={f.id}>
                <td>{f.userName || "N/A"}</td>
                <td>{f.mentorName}</td>
                <td>{f.week}</td>
                <td>{f.rating}</td>
                <td>{f.status}</td>
                <td>{f.submittedOn ? new Date(f.submittedOn).toLocaleDateString() : "N/A"}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default AllFeedbacks;
